import React, { Component } from 'react';
import "../App.css"

export default class  extends Component {
    render() {
        return (
            <div>
                <div className="content3">
                    <table>
                        <tr>
                            <th>Sr. No.</th>
                            <th>Doctor Name</th>
                            <th>Speciality</th>
                            <th>Timing</th>
                        </tr>
                        {
                            this.props.doctorsList.map((doctor) => {
                                <tr>
                                    <td>{doctor.name}</td>
                                    <td></td>
                                    <td></td>
                                    <td></td>
                                </tr>
                            })
                        }
                    </table>
                </div>
            </div>
        )
    }
}
